import React, { Component } from 'react';
class AddEpisode extends Component {


    render(){
        let { id, genre, status }  = this.props.match.params;

        return (
            <div>
                ID-ADD-EPISODE   : {id} {genre} {status}
                
            </div>        
        );
    }
}

export default AddEpisode;
